// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.0;

import "./Ownable.sol";

contract TechnoStore is Ownable {

    struct StoreProduct {
        uint id;
        string name;
    }

    mapping(uint => StoreProduct) public productList;
    mapping(uint => uint) public productStock;
    mapping(address => mapping(uint => bool)) public productPurchases;



    function addProduct(StoreProduct memory product, uint quantity) public onlyOwner {
        productList[product.id] = product;
        productStock[product.id] = quantity;
    }

